import React from 'react';
// src/App.js
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import img1 from "./images/103710.jpg"
import img2 from "./images/2225_854x480 - Copie.jpg"
import img3 from "./images/402866.jpg"
import img4 from "./images/497284.jpg"
import CarouselSlickControl from './Components/CarouselSlickControl';

const lesImages = [
    img1, img2, img3, img4
]

const App = () => {

    return(
        <CarouselSlickControl images={lesImages} />
    )
};

export default App;
